impl LocalTravel for MenuSpotId {
    fn local_travel_time(&self, dest: Self, movement_state: MovementState) -> u32 {
        match (movement_state, *self, dest) {
            _ => u32::MAX,
        }
    }

    fn local_movements(&self, movement_state: MovementState) -> Vec<(SpotId, u32)> {
        match (movement_state, *self) {
            ([false], MenuSpotId::Menu__Upgrade_Menu__Physiology) => vec![],
            ([false], MenuSpotId::Menu__Upgrade_Menu__Combat) => vec![],
            ([false], MenuSpotId::Menu__Upgrade_Menu__Infection) => vec![],
            ([false], MenuSpotId::Menu__Upgrade_Menu__Drone) => vec![],
            ([true], MenuSpotId::Menu__Upgrade_Menu__Physiology) => vec![],
            ([true], MenuSpotId::Menu__Upgrade_Menu__Combat) => vec![],
            ([true], MenuSpotId::Menu__Upgrade_Menu__Infection) => vec![],
            ([true], MenuSpotId::Menu__Upgrade_Menu__Drone) => vec![],
            _ => Vec::new(),
        }
    }

    fn is_connected_to(&self, dest: Self) -> bool {
        match (*self, dest) {
            _ => false,
        }
    }

    fn free_movement(&self, dest: Self) -> Option<u32> {
        match (*self, dest) {
            _ => None,
        }
    }

    fn best_movements(&self, dest: Self) -> (Option<u32>, Vec<(MovementState, u32)>) {
        match (*self, dest) {
            _ => (None, Vec::new()),
        }
    }
}
pub fn local_movements(movement_state: MovementState, src: SpotId) -> Vec<(SpotId, u32)> {
    match src {
        SpotId::None => Vec::new(),
        SpotId::Amagi(s) => s.local_movements(movement_state),
        SpotId::Antarctica(s) => s.local_movements(movement_state),
        SpotId::Ebih(s) => s.local_movements(movement_state),
        SpotId::Giguna_Breach(s) => s.local_movements(movement_state),
        SpotId::Giguna(s) => s.local_movements(movement_state),
        SpotId::Glacier(s) => s.local_movements(movement_state),
        SpotId::Irikar_Breach(s) => s.local_movements(movement_state),
        SpotId::Irikar(s) => s.local_movements(movement_state),
        SpotId::Menu(s) => s.local_movements(movement_state),
    }
}

pub fn local_travel_time(movement_state: MovementState, src: SpotId, dest: SpotId) -> u32 {
    match (src, dest) {
        (SpotId::Amagi(s), SpotId::Amagi(d)) => s.local_travel_time(d, movement_state),
        (SpotId::Antarctica(s), SpotId::Antarctica(d)) => s.local_travel_time(d, movement_state),
        (SpotId::Ebih(s), SpotId::Ebih(d)) => s.local_travel_time(d, movement_state),
        (SpotId::Giguna_Breach(s), SpotId::Giguna_Breach(d)) => {
            s.local_travel_time(d, movement_state)
        }
        (SpotId::Giguna(s), SpotId::Giguna(d)) => s.local_travel_time(d, movement_state),
        (SpotId::Glacier(s), SpotId::Glacier(d)) => s.local_travel_time(d, movement_state),
        (SpotId::Irikar_Breach(s), SpotId::Irikar_Breach(d)) => {
            s.local_travel_time(d, movement_state)
        }
        (SpotId::Irikar(s), SpotId::Irikar(d)) => s.local_travel_time(d, movement_state),
        (SpotId::Menu(s), SpotId::Menu(d)) => s.local_travel_time(d, movement_state),
        _ => u32::MAX,
    }
}

pub fn are_spots_connected(src: SpotId, dest: SpotId) -> bool {
    match (src, dest) {
        _ => false,
    }
}

